      | 364023 -> { ItemTypeData.id= 364023; name= "Assault gk.0"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.  Gallente forces have access to some of the most advanced armor systems in the cluster. An ablative-variant solution is used to dissipate energy across available surface area with only minimal degradation of the material at the impact point resulting in armor that is efficient and durable enough to maintain operational integrity for multiple short-term engagements. Augmented ferro-fibre musculature enhances the soldier’s strength, balance, and reaction time, while quad-opsis sensors allow wide arc identification and prioritization of battlefield targets.  Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 364411 -> { ItemTypeData.id= 364411; name= "Duvolle Quantum Active Scanner"; published= false; description= "Sending out a triggered pulse of high-frequency magnetometric waves and interpreting the results with an uplinked onboard computer, the Active Scanner gives ground units a snapshot of enemy positions. Projection nodes set at specific angles on the hand-held device, generate a vectored impulse capable of extracting objects from high-noise environments. Feedback from the pulse is filtered to reduce ambient clutter and pinpoint targets lacking IFF signals.  Though the amount of energy required to produce the blast is much greater than its on-board power source can readily generate, the Active Scanner makes use of redundant J-24 micro-capacitors to circulate and build the charge up to the required output. The resulting delay between activations is a small price to pay for the enormous tactical advantage the device provides its user."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
